import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';


(async () => {
  const url = 'https://polar-beach-08187.herokuapp.com/api/pets/2';
  const response = await fetch(url);
  if (response.ok) {
    const pet = await response.json();
    console.log(pet)

    ReactDOM.render(
      <React.StrictMode>
        <App pet={pet}/>
      </React.StrictMode>,
      document.getElementById('root')
    );
  }
})();
